      SELECT ALL 78 / - col0 FROM tab1 (FORMAT parquet) WHERE NOT ( - col1 + CAST ( NULL AS INTEGER ) ) NOT BETWEEN - ( col0 ) / - 14 + col1 AND NULL;
  - name: tab1

outputs:
  - name: q5758.out
    data: |
